import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import * as i1 from "../style/styledchangeinfo1";

const Changeinfo1 = () => {
  const navigate = useNavigate();
  const [selectedBox, setSelectedBox] = useState(null); // ÌÅ¥Î¶≠Îêú Î∞ïÏä§Ïùò Ïù∏Îç±Ïä§Î•º Í¥ÄÎ¶¨

  const goMain = () => {
    navigate(`/`);
  };

  // ÌÅ¥Î¶≠Îêú Î∞ïÏä§Ïùò ÏÉÅÌÉúÎ•º ÏóÖÎç∞Ïù¥Ìä∏ÌïòÎäî Ìï®Ïàò
  const handleBoxClick = (index) => {
    setSelectedBox(index); // ÌÅ¥Î¶≠Îêú Î∞ïÏä§Ïùò Ïù∏Îç±Ïä§Î•º ÏÉÅÌÉúÎ°ú Ï†ÄÏû•
  };

  return (
    <i1.Container>
      <i1.Header>
        <img
          id="back"
          src={`${process.env.PUBLIC_URL}/logo/backbtn.svg`}
          alt="back button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="logo"
          src={`${process.env.PUBLIC_URL}/logo/ylogo.svg`}
          alt="logo"
          width="40px"
          onClick={goMain}
        />
        <img
          id="alarm"
          src={`${process.env.PUBLIC_URL}/logo/alarm.svg`}
          alt="alarm button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="menu"
          src={`${process.env.PUBLIC_URL}/logo/menu.svg`}
          alt="menu button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <i1.Border>
          <div></div>
        </i1.Border>
      </i1.Header>

      <i1.Ybox>
        <i1.Top>
          ÎÇòÏóêÍ≤å{" "}
          <span style={{ fontWeight: "bold", fontSize: "20px" }}>
            Îî± ÎßûÎäî ÎßûÏ∂§ ÎπÑÍµê
          </span>
          Î•º ÏúÑÌï¥
          <br />
          <span style={{ fontWeight: "bold", fontSize: "20px" }}>
            ÌÇ§ÏõåÎìú ÏÑ†ÌÉù
          </span>
          ÏùÑ ÏßÑÌñâÌï¥ Ï£ºÏÑ∏Ïöî!
        </i1.Top>

        <i1.Text>
          <br />
          <br />
          üî¥ <span>Ïó∞Î†πÎåÄ</span>Î•º ÏÑ†ÌÉùÌï¥ Ï£ºÏÑ∏Ïöî.
        </i1.Text>
      </i1.Ybox>

      <i1.Body>
        <i1.Box>
          <i1.Box2>
            {[
              "19ÏÑ∏ Ïù¥Ìïò",
              "20~29ÏÑ∏",
              "30~39ÏÑ∏",
              "40~49ÏÑ∏",
              "50~59ÏÑ∏",
              "60~69ÏÑ∏",
              "70ÏÑ∏ Ïù¥ÏÉÅ",
            ].map((ageRange, index) => (
              <i1.Keywordd key={index}>
                <i1.SmallBox5
                  isClicked={selectedBox === index} // ÌÅ¥Î¶≠ ÏÉÅÌÉúÏóê Îî∞Îùº Ïä§ÌÉÄÏùº Ï†ÅÏö©
                  onClick={() => handleBoxClick(index)} // ÌÅ¥Î¶≠ Ïãú ÏÉÅÌÉú ÏóÖÎç∞Ïù¥Ìä∏
                >
                  <span style={{ fontWeight: "500", fontSize: "15px" }}>
                    {ageRange}
                  </span>
                </i1.SmallBox5>
              </i1.Keywordd>
            ))}
          </i1.Box2>
        </i1.Box>

        <i1.Button>
          <img
            id="restore"
            src={`${process.env.PUBLIC_URL}/logo/restore.svg`}
            alt="restore"
            onClick={goMain}
          />
        </i1.Button>
      </i1.Body>
    </i1.Container>
  );
};

export default Changeinfo1;
